import React from 'react';
import '../../App.css';
import ImageCarousel from '../ImageCarousel';
import Grid from "@mui/material/Grid";

function Carousel() {
  const imagesData = ['./images/Guanacaste.jpg',"https://placeimg.com/640/480/any/2","https://placeimg.com/640/480/any/3"]
  return (
    <div className='slider'>
        <Grid container spacing={4}>
          <Grid item xs={3}>
              <ImageCarousel data={imagesData}/>
          </Grid>
          <Grid item xs={5}>

          </Grid>
          <Grid item xs={4}>

          </Grid>
        </Grid>
      </div>

  );
}

export default Carousel;
